    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE NOT - + 80 / col2 * - - col2 / + col0 BETWEEN + col1 * + col2 * 68 / ( col2 ) AND + 20;
  - name: tab1

outputs:
  - name: q6776.out
    data: |
      51	14	96
      85	5	59
      91	47	68
